import React from 'react';

import classes from './Area.module.css';

const Area = (props) => {

    let attachedClasses = [classes.Area];

    return (
        <div className={classes.Area}>
            <img src={props.image} alt={props.description}/>
            <p>{props.description}</p>
        </div>
    );
};

export default Area;
